import About from "./About/About";
import Contact from "./Contact/Contact";
import Details from "./Details/Details";
import Navbar from "./Header/Navbar";
import Portfolio from "./Portfolio/Portfolio";
import Service from "./Service/Service";
import Stage from "./Stage/Stage";
import Tagline from "./TagLine/Tagline";
import Team from "./Team/Team";
function App() {
  return (
    <div className="App">
      <div>
        {/* end of preloader */}
        {/* Navbar */}
        <Navbar />
        <Tagline />
        {/* Intro */}
        <div id="intro" className="basic-1">
          <div className="container">
            <div className="row">
              <div className="col-lg-5">
                <div className="text-container">
                  <div className="section-title">INTRO</div>
                  <h2>
                    It is a long established fact that a reader will be
                    distracted by the
                  </h2>
                  <p>
                    it look like readable English. Many desktop publishing
                    packages and web page editors now use Lorem Ipsum as their
                    default model text, and a search for 'lorem ipsum'
                  </p>
                  <p className="testimonial-text">
                    will uncover many web sites still in their infancy. Various
                    versions have evolved over the years, sometimes by accident,
                    sometimes on purpose (injected humour and the like).
                  </p>
                  <div className="testimonial-author">Rakib Islam - CEO</div>
                </div>{" "}
                {/* end of text-container */}
              </div>{" "}
              {/* end of col */}
              <div className="col-lg-7">
                <div className="image-container">
                  <img
                    className="img-fluid"
                    src="assets/images/intro-office.jpg"
                    alt="alternative"
                  />
                </div>{" "}
                {/* end of image-container */}
              </div>{" "}
              {/* end of col */}
            </div>{" "}
            {/* end of row */}
          </div>{" "}
          {/* end of container */}
        </div>{" "}
        {/* end of basic-1 */}
        {/* end of intro */}
        <Stage />
        {/* Services */}
        <Service />
        {/* end of cards-2 */}
        {/* end of services */}
        {/* Details 1 */}
        {/* end of accordion */}
        {/* end of details 1 */}
        <Details />
        <Portfolio />
        {/* Team */}
        <Team />
        {/* About */}
        <About />
        {/* Contact */}
        <Contact />
        {/* end of form-2 */}
        {/* end of contact */}
        {/* Footer */}
        <div className="footer">
          <div className="container">
            <div className="row">
              <div className="col-md-6">
                <div className="text-container about">
                  <h4>Few Words About Brainboxbd</h4>
                  <p className="white">
                    We're passionate about delivering the best business growth
                    services for companies just starting out as startups or
                    industry players that have established their market position
                    a long tima ago.
                  </p>
                </div>{" "}
                {/* end of text-container */}
              </div>{" "}
              {/* end of col */}
              <div className="col-md-2">
                <div className="text-container">
                  <h4>Links</h4>
                  <ul className="list-unstyled li-space-lg white">
                    <li>
                      <a className="white" href="#your-link">
                        startupguide.com
                      </a>
                    </li>
                    <li>
                      <a className="white" href="terms-conditions.html">
                        Terms &amp; Conditions
                      </a>
                    </li>
                    <li>
                      <a className="white" href="privacy-policy.html">
                        Privacy Policy
                      </a>
                    </li>
                  </ul>
                </div>{" "}
                {/* end of text-container */}
              </div>{" "}
              {/* end of col */}
              <div className="col-md-2">
                <div className="text-container">
                  <h4>Tools</h4>
                  <ul className="list-unstyled li-space-lg">
                    <li>
                      <a className="white" href="#your-link">
                        aria
                      </a>
                    </li>
                    <li>
                      <a className="white" href="#your-link">
                        influencers.com
                      </a>
                    </li>
                    <li className="media">
                      <a className="white" href="#your-link">
                        optimizer.net
                      </a>
                    </li>
                  </ul>
                </div>{" "}
                {/* end of text-container */}
              </div>{" "}
              {/* end of col */}
              <div className="col-md-2">
                <div className="text-container">
                  <h4>Partners</h4>
                  <ul className="list-unstyled li-space-lg">
                    <li>
                      <a className="white" href="#your-link">
                        unicorns.com
                      </a>
                    </li>
                    <li>
                      <a className="white" href="#your-link">
                        staffmanager.com
                      </a>
                    </li>
                    <li>
                      <a className="white" href="#your-link">
                        association.gov
                      </a>
                    </li>
                  </ul>
                </div>{" "}
                {/* end of text-container */}
              </div>{" "}
              {/* end of col */}
            </div>{" "}
            {/* end of row */}
          </div>{" "}
          {/* end of container */}
        </div>{" "}
        {/* end of footer */}
        {/* end of footer */}
        {/* Copyright */}
        <div className="copyright">
          <div className="container">
            <div className="row">
              <div className="col-lg-12">
                <p className="p-small">
                  Copyright © 2020{" "}
                  <a href="https://inovatik.com">Template by Inovatik</a>
                </p>
              </div>{" "}
              {/* end of col */}
            </div>{" "}
            {/* enf of row */}
          </div>{" "}
          {/* end of container */}
        </div>{" "}
        {/* end of copyright */}
        {/* end of copyright */}
        {/* Scripts */}
        {/* jQuery for Bootstrap's JavaScript plugins */}
        {/* Popper tooltip library for Bootstrap */}
        {/* Bootstrap framework */}
        {/* jQuery Easing for smooth scrolling between anchors */}
        {/* Swiper for image and text sliders */}
        {/* Magnific Popup for lightboxes */}
        {/* Morphtext rotating text in the header */}
        {/* Isotope for filter */}
        {/* Validator.js - Bootstrap plugin that validates forms */}
        {/* Custom scripts */}
      </div>
    </div>
  );
}

export default App;
